        <ul>
          <li><strong>Free:</strong> Basic investment tracking</li>
          <li><strong>Pro:</strong> $9.99/month – AI tools + portfolio analysis</li>
          <li><strong>Premium:</strong> $19.99/month – All features + advisor chat</li>
        </ul>
      </div>
    </div>
  );
}
